webpackJsonp([88025333830971],{328:function(A,e){A.exports={data:{markdownRemark:{html:'<p>2017 turned out to be quite the year! After spending 5 years at the University of Colorado Boulder studying Computer Science and Digital Media, I’m happy to finally be done with school. What a trip that was! Academia was never my forte, and I always gravitated towards learning by doing instead of studying for exams or doing homework assignments. I guess I’ll forever be a student regardless of whether I’m in school or not. There are so many fascinating things to learn about that there isn’t nearly enough hours in the day to do it all. I definitely enjoy looking back to those all nighters working on programming assignments or putting off papers until the last day, either because I would rather procrastinate by playing music or going out with friends or doing other crazy things. I’m surprised I even survived all of that. Regardless, I’m grateful for the experience and all the personal and professional growth that came with it.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ea265.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.2037037037037%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Creekside Apartments"\n        title=""\n        src="/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ec749.jpg"\n        srcset="/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-d894e.jpg 173w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-97c21.jpg 345w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ec749.jpg 690w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-f7d37.jpg 1035w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ea265.jpg 1080w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>My old bedroom-studio for most of my college career. Good memories here.</em></p>\n<p>In the midst of trying to finish school without failing my final exams, I was desperately looking for a full time job. The whole thing was such a scramble. It took me precisely 43 job interviews, only 2 of which turned into legitimate offers. Now, I’m makin’ stuff at <a href="http://viget.com">Viget</a>, a full-service interactive agency that specializes in custom web software and hardware. It’s been such a trip working with a really talented group of people doing a variety of things these past 6 months, and I’m excited to see where my journey with Viget leads to. None of this would’ve been possible without the things I learned from my previous job at <a href="http://alpinelaboratories.com">Alpine Labs</a>, a hardware startup that built remote triggers for DSLR cameras. That’s where I really got to see the marriage of hardware and software, and how powerful web technologies can be, especially JavaScript.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/viget-df4bb6554f14a958bef15672949dc801-ea265.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.48148148148148%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Viget React JavaScript"\n        title=""\n        src="/static/viget-df4bb6554f14a958bef15672949dc801-ec749.jpg"\n        srcset="/static/viget-df4bb6554f14a958bef15672949dc801-d894e.jpg 173w,\n/static/viget-df4bb6554f14a958bef15672949dc801-97c21.jpg 345w,\n/static/viget-df4bb6554f14a958bef15672949dc801-ec749.jpg 690w,\n/static/viget-df4bb6554f14a958bef15672949dc801-f7d37.jpg 1035w,\n/static/viget-df4bb6554f14a958bef15672949dc801-ea265.jpg 1080w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I’ve had the opportunity to make some really cool stuff at Viget. Tech wise, I’m heavily exploring JavaScript and React, two pieces of technology which have changed the way I look at software. It’s seriously such an exciting time to be a web programmer. There’s so many avenues to explore, but for me, it’s always been about making art and using the browser or the smartphone as my canvas. I’ve been exploring a lot of WebGL, GLSL, WebVR, and Mobile AR on my free time as well. I think the ideal day for me would be to spend half of it programming graphics and the other half playing music. Maybe one day.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-01697.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100.1132502831257%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="HoloLens at MIT Media Lab"\n        title=""\n        src="/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-ec749.jpg"\n        srcset="/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-d894e.jpg 173w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-97c21.jpg 345w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-ec749.jpg 690w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-f7d37.jpg 1035w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-31ec7.jpg 1380w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-d9d57.jpg 2070w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-01697.jpg 3532w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Playing around with the Microsoft HoloLens at MIT during a hackathon.</em></p>\n<p>Something really cool that I got to take part in this year was a VR/AR Hackathon at the MIT Media Lab. Our team ended up placing third for the Everyday Mobile AR Hack Award by Samsung for our project <a href="https://devpost.com/software/luminate">Luminate</a>. It was a really hectic but fun experience and I’m definitely looking forward to attending more hackathons in the future.</p>\n<p>Onto music –</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sonder-7028e2b073fc85a219532655a25d8e93-a7415.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.885416666666664%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Prayash Thapa Sam Martin Piano Guitar Sonder"\n        title=""\n        src="/static/sonder-7028e2b073fc85a219532655a25d8e93-ec749.jpg"\n        srcset="/static/sonder-7028e2b073fc85a219532655a25d8e93-d894e.jpg 173w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-97c21.jpg 345w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-ec749.jpg 690w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-f7d37.jpg 1035w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-31ec7.jpg 1380w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-d9d57.jpg 2070w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-a7415.jpg 3840w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>One of the videos I did manage to make with my music buddy Sam Martin. Scope it <a href="https://www.youtube.com/watch?v=DwvlEhy5q5Y">here</a>!</em></p>\n<p>Now that I have no academic commitments, it’s been much easier to allocate time for music. The electro-acoustic stuff that <a href="http://soundcloud.com/effulgence">I used to upload on SoundCloud</a> is still there, but I’m honestly more focused on honing my chops on the guitar before going back to the computer. I’d also like to focus on creating more videos instead of delivering just audio. I think there’s a lot to be explored in the audiovisual realm, especially once realtime software components are brought into the equation. I’ve got a few ideas brewing for the moment, but nothing concrete yet. There’s a million ways in how the software + music + visuals recipe could pan out, so more on that soon! As of right now, I have two new videos on YouTube, both made by my good friend Ben Crawford. One is about <a href="https://www.youtube.com/watch?v=UHDN-TyN92U">why I do what I do</a>, and the other, <a href="https://www.youtube.com/watch?v=2PNG4Nei8CI">a 60 second fingerstyle cover of The Scientist by Coldplay</a>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-a7415.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.25%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Prayash Thapa Fingerstyle Guitar"\n        title=""\n        src="/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-ec749.jpg"\n        srcset="/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-d894e.jpg 173w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-97c21.jpg 345w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-ec749.jpg 690w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-f7d37.jpg 1035w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-31ec7.jpg 1380w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-d9d57.jpg 2070w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-a7415.jpg 3840w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Just a nerd and his guitar in the middle of a forest in Flagstaff, Boulder.</em></p>\n<p>Traveling is fun, and I got to see a little more of the States this year. Ever since my <a href="http://prayash.io/blog/undiscovered-colors">study abroad trip to Argentina</a>, I’ve had the itch to visit new, unfamiliar places. It’s always really inspiring to travel and come back to things with a fresh and recalibrated perspective.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/new-mexico-022526b259377b685546e33069fbe0d1-ea265.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.48148148148148%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="New Mexico with the family"\n        title=""\n        src="/static/new-mexico-022526b259377b685546e33069fbe0d1-ec749.jpg"\n        srcset="/static/new-mexico-022526b259377b685546e33069fbe0d1-d894e.jpg 173w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-97c21.jpg 345w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-ec749.jpg 690w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-f7d37.jpg 1035w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-ea265.jpg 1080w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>So, here’s to hoping the trend will continue in 2018. Looking forward to more art, more music, more traveling, and more living in general. 👍</p>',timeToRead:4,frontmatter:{date:"December 25, 2017",title:"2017: A Year in Review"}}},pathContext:{slug:"/blog/2017"}}}});
